import { ActionType, ProFormText } from '@ant-design/pro-components';
import { CreekTable, useApp } from '@creekjs/web-components';
import { useMemoizedFn } from 'ahooks';
import { Button, Form, Typography } from 'antd';
import { useRef } from 'react';

import service from '@/service';

const HomePage = () => {
  const [form] = Form.useForm();

  const { modal } = useApp();

  const tableActionRef = useRef<ActionType>();

  const openModal = useMemoizedFn((data?: API.Store) => {
    modal.openForm({
      form,
      modalProps: {
        width: 400,
        title: data?.id ? '': '',
      },
      onFinish: async (values) => {
        await service.dianpuguanli.createStore(values);
        tableActionRef.current?.reload();
        return true;
      },
      content: (
        <>
          <ProFormText
            rules={[
              {
                required: true,
              },
            ]}
            initialValue={data?.storeName}
            required
            width="md"
            name="storeName"
            label=""
            tooltip=" 24 "
            placeholder=""
          />
        </>
      ),
    });
  });

  const deleteStore = useMemoizedFn(async (storeId?: number) => {
    modal.confirm({
      title: '',
      okText: '',
      okType: 'danger',
      onOk: async () => {
        if (storeId) {
          await service.dianpuguanli.deleteStore({ id: storeId });
          tableActionRef.current?.reload();
        }
      },
    });
  });


  return (
    <>
      <CreekTable<API.Store, API.getStoresPageParams>
        actionRef={tableActionRef}
        rowKey="storeName"
        request={(params) => {
          return service.dianpuguanli.getStoresPage(params);
        }}
        toolBarRender={() => {
          return [
            <Button type="primary" key="new" onClick={() => openModal()}>

            </Button>,
          ];
        }}
        columns={[
          {
            dataIndex: 'storeName',
            title: '',
          },
          {
            dataIndex: 'createTime',
            title: '',
            search: false,
          },
          {
            dataIndex: 'createTime',
            title: '',
            search: false,
          },
          {
            dataIndex: 'operation',
            title: '',
            valueType: 'option',
            render: (_, record) => {
              return (
                <>
                  <Typography.Link onClick={() => openModal(record)}></Typography.Link>
                  <Typography.Link onClick={() => deleteStore(record.id)}></Typography.Link>
                </>
              );
            },
            search: false,
          },
        ]}
      />
    </>
  );
};

export default HomePage;

